// Split the text into chunks, ensuring each chunk ends at a sentence boundary
const blocks = [];
let currentBlock = "";

// Regular expression to match sentence-ending punctuation followed by a space or end of string
const sentenceEndPattern = /([.!?])(\s|$)/g;
let lastIndex = 0;

while (lastIndex < inputText.length) {
    // Find the next sentence boundary
    const match = sentenceEndPattern.exec(inputText);
    if (!match) break;

    const sentenceEnd = match.index + match[0].length;

    // If adding this sentence to the current block doesn't exceed 1800 characters, add it
    if (currentBlock.length + (sentenceEnd - lastIndex) <= 2000) {
        currentBlock += inputText.slice(lastIndex, sentenceEnd);
        lastIndex = sentenceEnd;
    } else {
        // If it exceeds 1800 characters, push the current block and start a new one
        blocks.push(currentBlock.trim());
        currentBlock = inputText.slice(lastIndex, sentenceEnd);
        lastIndex = sentenceEnd;
    }
}

// Add the last block if there's any leftover text
if (currentBlock.length > 0) {
    blocks.push(currentBlock.trim());
}

// Return the array with a better key name
return blocks.map((block, index) => ({
    blockNumber: index + 1,
    content: block
}));
